@unbubbleIch habe zwar unter "DAS RANKING" schon meine Meinung geschrieben, aber ich kann es gerne noch mal kopieren:

Ich finde das Format ganz interessant. Man knnte vielleicht auch in Zukunft 3 Personen diskutieren lassen, um mehr Perspektiven zu haben.
Was mich ein bisschen strt, ist, dass man sich von vornherein fr einen Platz festlegen muss, den man nicht mehr ndern kann. Das verflscht das Ranking. Man sollte aus meiner Sicht neue zu rankende Dinge immer zwischen andere packen knnen.
